// src/App.js
import React from 'react';
import RegisterFace from './components/RegisterFace';
import AuthenticateFace from './components/AuthenticateFace';
import CheckFaceDetection from './components/CheckFaceDetection';

function App() {
  return (
    <div>
      <h1>Face Recognition App</h1>
      <RegisterFace />
      <AuthenticateFace />
      <CheckFaceDetection />
    </div>
  );
}

export default App;
